import { SelectionModel } from '@angular/cdk/collections';
import { Validators } from '@angular/forms';
import { MatCheckbox } from '@angular/material/checkbox';
import { MatPaginator } from '@angular/material/paginator';
import { MatRadioButton } from '@angular/material/radio';
import { MatSort } from '@angular/material/sort';
import { fromEvent, merge } from 'rxjs';
import { debounceTime, distinctUntilChanged, first, switchMap, tap } from 'rxjs/operators';
import { ClassesSessionsDataSource } from '../common/tableDataHelper/classes-sessions.datasource';
import * as i0 from "@angular/core";
import * as i1 from "@angular/router";
import * as i2 from "@angular/forms";
import * as i3 from "../class-session.service";
import * as i4 from "src/app/classes-groups/class-group.service";
import * as i5 from "src/app/lectures/lecture-types/lecture-type.service";
import * as i6 from "src/app/courses-schedules/course-schedule.service";
import * as i7 from "src/app/lectures/lecture-edit/services/course-schedule-select-dialog.sevice";
import * as i8 from "src/app/lectures/lecture.service";
